o.in, we are extremely proud of our commitment to protect y<span class="_ _0"></span>our privacy. </div><div class="t m0 x1 h3 y19 ff4 fs2 fc0 sc0 ls0 ws0">We value your trust in us. We will work hard to earn y<span class="_ _0"></span>our confidence so that you can </div><div class="t m0 x1 h3 y1a ff4 fs2 fc0 sc0 ls0 ws0">enthusiastically use our services and recommend us to friends and family. Please read the </div><div class="t m0 x1 h3 y1b ff4 fs2 fc0 sc0 ls0 ws0">following policy to understand how y<span class="_ _0"></span>our personal information will be treated as you make full </div><div class="t m0 x1 h3 y1c ff4 fs2 fc0 sc0 ls0 ws0">use of our Site.  </div><div class="t m0 x1 h3 y1d ff4 fs2 fc0 sc0 ls0 ws0">2. <span class="ff6">www.talegaon.co.in Privacy Guarantee</span> </div><div class="t m0 x1 h3 y1e ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in promises that we will not sell or ren<span class="ff4">t your personal information to third </span></div><div class="t m0 x1 h3 y1f ff4 fs2 fc0 sc0 ls0 ws0">parties for their marketing purposes without your explicit consent. From time to time we may<span class="_ _0"></span> </div><div class="t m0 x1 h3 y20 ff4 fs2 fc0 sc0 ls0 ws0">reveal general statistical information about our Web site and visitors, such as number of<span class="_ _0"></span> visitors, </div><div class="t m0 x1 h3 y21 ff4 fs2 fc0 sc0 ls0 ws0">number and type of goods and services purchased, etc. Your trust and confidence are our highest </div><div class="t m0 x1 h3 y22 ff4 fs2 fc0 sc0 ls0 ws0">priority.  </div><div class="t m0 x1 h3 y23 ff4 fs2 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h4 y24 ff4 fs2 fc0 sc0 ls0 ws0">3. <span class="ff3">Information we collect</span> </div><div class="t m0 x1 h3 y25 ff4 fs2 fc0 sc0 ls0 ws0">When you use our Site, we collect and store your persona<span class="_ _0"></span>l information from <span class="_ _1"></span>you. Our<span class="_ _0"></span> primary </div><div class="t m0 x1 h3 y26 ff4 fs2 fc0 sc0 ls0 ws0">goal in doing so is to provide a safe, efficient, smooth and customized experience. This allows us </div><div class="t m0 x1 h3 y27 ff4 fs2 fc0 sc0 ls0 ws0">to provide services and features that most likely<span class="_ _0"></span> meet your needs, and to customize our Site to </div><div class="t m0 x1 h3 y28 ff4 fs2 fc0 sc0 ls0 ws0">make your experience safer a<span class="_ _0"></span>nd easier. Importantly, we only collect personal information about </div><div class="t m0 x1 h3 y29 ff4 fs2 fc0 sc0 ls0 ws0">you that we consider necessary for achieving this purpose. </div><div class="t m0 x1 h3 y2a ff4 fs2 fc0 sc0 ls0 ws0">In general, you can browse the Site without telling us who y<span class="_ _0"></span>ou are or revealing any personal </div><div class="t m0 x1 h3 y2b ff4 fs2 fc0 sc0 ls0 ws0">information about yourself. Once you give us your personal information, you are not anonymous </div><div class="t m0 x1 h3 y2c ff4 fs2 fc0 sc0 ls0 ws0">to us. To fully use our Site, you will need to register using our online registration form, where </div><div class="t m0 x1 h3 y2d ff4 fs2 fc0 sc0 ls0 ws0">you may be required to provide us with your name, date of birth, contact number, email id, user </div><div class="t m0 x1 h3 y2e ff4 fs2 fc0 sc0 ls0 ws0">id, password,  residence / place of business information, billing information, shipping </div><div class="t m0 x1 h3 y2f ff4 fs2 fc0 sc0 ls0 ws0">information, bank account details and other personal information as indicated on the for<span class="_ _0"></span>ms </div><div class="t m0 x1 h3 y30 ff4 fs2 fc0 sc0 ls0 ws0">throughout the Site. Where possible, we<span class="_ _0"></span> indicate which fields are required and which fields are </div><div class="t m0 x1 h3 y31 ff4 fs2 fc0 sc0 ls0 ws0">optional. You always have the option to not provide information by choosing not to use a </div><div class="t m0 x1 h5 y32 ff5 fs2 fc0 sc0 ls0 ws0">particular service or feature on the Site. You may provide us with a <span class="_ _0"></span>www.talegaon.co.in </div><div class="t m0 x1 h3 y33 ff4 fs2 fc0 sc0 ls0 ws0">username. </div><div class="t m0 x1 h3 y34 ff4 fs2 fc0 sc0 ls0 ws0">We may automatically track certa<span class="_ _0"></span>in information about you based upon your behavior on our site. </div><div class="t m0 x1 h3 y35 ff4 fs2 fc0 sc0 ls0 ws0">We use this information to do internal research on our users&apos; demographics, interests, and </div><div class="t m0 x1 h3 y36 ff4 fs2 fc0 sc0 ls0 ws0">behavior to better understand, protect and serve our users. This information is compiled and </div><div class="t m0 x1 h3 y37 ff4 fs2 fc0 sc0 ls0 ws0">analyzed on an aggregated basis. This information may<span class="_ _0"></span> include the URL that you just came from </div><div class="t m0 x1 h3 y38 ff4 fs2 fc0 sc0 ls0 ws0">(whether this URL is on our site or not), which URL you next go to (whether this URL is on our </div><div class="t m0 x1 h3 y39 ff4 fs2 fc0 sc0 ls0 ws0">site or not), your computer browser information, and your I<span class="_ _0"></span>P address.<span class="_ _1"></span> </div><div class="t m0 x1 h3 y3a ff4 fs2 fc0 sc0 ls0 ws0">We use data collection devices such as &quot;cookies&quot; on certain pages of the Site to help analy<span class="_ _0"></span>ze our </div><div class="t m0 x1 h3 y3b ff4 fs2 fc0 sc0 ls0 ws0">web page flow, measure promotional effectiveness, and promote trust and safety. &quot;Cookies&quot; are<span class="_ _0"></span> </div><div class="t m0 x1 h3 y3c ff4 fs2 fc0 sc0 ls0 ws0">small files placed on your hard drive that assist us in providing our service<span class="_ _0"></span>s. We offer certain </div><div class="t m0 x1 h3 y3d ff4 fs2 fc0 sc0 ls0 ws0">features that are only available throug<span class="_ _0"></span>h the use of a &quot;cookie&quot;. We also use cookies<span class="_ _1"></span> to allow you </div><div class="t m0 x1 h3 y3e ff4 fs2 fc0 sc0 ls0 ws0">to enter your password less frequently during a session. Cookies can also help us provide </div><div class="t m0 x1 h3 y3f ff4 fs2 fc0 sc0 ls0 ws0">information that is targeted to y<span class="_ _0"></span>our interests. Most cookies are &quot;session cookies,&quot; meaning that </div><div class="t m0 x1 h3 y40 ff4 fs2 fc0 sc0 ls0 ws0">they are automatically deleted from your hard dr<span class="_ _0"></span>ive at the end of a session. <span class="_ _1"></span>You are always free </div><div class="t m0 x1 h3 y41 ff4 fs2 fc0 sc0 ls0 ws0">to decline our cookies if y<span class="_ _0"></span>our browser permits, although in that case you may not be able to use </div><div class="t m0 x1 h3 y42 ff4 fs2 fc0 sc0 ls0 ws0">certain features on the Site and you may be<span class="_ _0"></span> required to reenter your password more frequently </div><div class="t m0 x1 h3 y43 ff4 fs2 fc0 sc0 ls0 ws0">during a session. </div><div class="t m0 x1 h3 y44 ff4 fs2 fc0 sc0 ls0 ws0">Additionally, you may encounter &quot;cookies&quot; or other similar devices on certain pages of the<span class="_ _0"></span> Site </div><div class="t m0 x1 h3 y45 ff4 fs2 fc0 sc0 ls0 ws0">that are placed by third parties. For example, if y<span class="_ _0"></span>ou view a web page created by a user, there may </div><div class="t m0 x1 h3 y46 ff4 fs2 fc0 sc0 ls0 ws0">be a &quot;cookie&quot; placed within that web page. We do not control the use of cookies by third parties. </div><div class="t m0 x1 h3 y47 ff4 fs2 fc0 sc0 ls0 ws0">If you choose to, buy or sell on the Site, we collec<span class="_ _0"></span>t information about your, buying and selling </div><div class="t m0 x1 h3 y48 ff4 fs2 fc0 sc0 ls0 ws0">behavior. We also collect other users&apos; c<span class="_ _0"></span>omments about <span class="_ _1"></span>you in our feedback area<span class="_ _0"></span>. <span class="_ _1"></span> </div><div class="t m0 x1 h3 y49 ff4 fs2 fc0 sc0 ls0 ws0">If you establish a credit account with us to pay the fees we charge, we collect some additional </div><div class="t m0 x1 h3 y4a ff4 fs2 fc0 sc0 ls0 ws0">information, such as a billing address, a credit/ debit card number and a credit/ debit card </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf3" class="pf w0 h0" data-page-no="3"><div class="pc pc3 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h3 y24 ff4 fs2 fc0 sc0 ls0 ws0">expiration date and/ or other payment instrument details and trac<span class="_ _0"></span>king information from cheque or </div><div class="t m0 x1 h3 y4b ff4 fs2 fc0 sc0 ls0 ws0">money orders.  </div><div class="t m0 x1 h3 y26 ff4 fs2 fc0 sc0 ls0 ws0">If you choose to post messages on our message boards, chat rooms or other message areas or </div><div class="t m0 x1 h3 y27 ff4 fs2 fc0 sc0 ls0 ws0">leave feedback for other users, we will collec<span class="_ _0"></span>t that information you provide to us. We retain this </div><div class="t m0 x1 h3 y28 ff4 fs2 fc0 sc0 ls0 ws0">information as necessary to resolve disputes, provide customer service and troubleshoot </div><div class="t m0 x1 h3 y29 ff4 fs2 fc0 sc0 ls0 ws0">problems as permitted by law. </div><div class="t m0 x1 h3 y2a ff4 fs2 fc0 sc0 ls0 ws0">If you send us personal correspondence, such as emails or letters, or if other users or third parties </div><div class="t m0 x1 h3 y2b ff4 fs2 fc0 sc0 ls0 ws0">send us correspondence about your activities or postings on the<span class="_ _0"></span> Site, we may collect such </div><div class="t m0 x1 h3 y2c ff4 fs2 fc0 sc0 ls0 ws0">information into a file specific to you. </div><div class="t m0 x1 h3 y4c ff4 fs2 fc0 sc0 ls0 ws0">If you register for the Site on another<span class="_ _0"></span> web site or use a web site providing a service for </div><div class="t m0 x1 h5 y4d ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in or a web site that helps facilitates your activity on the Site, that web site </div><div class="t m0 x1 h3 y4e ff4 fs2 fc0 sc0 ls0 ws0">may provide personal information about you and your transactions back to us.  </div><div class="t m0 x1 h4 y4f ff4 fs2 fc0 sc0 ls0 ws0">4. <span class="ff3">Our use of your information </span> </div><div class="t m0 x1 h3 y50 ff4 fs2 fc0 sc0 ls0 ws0">We use your personal information to facilitate the<span class="_ _0"></span> services you request. We use your personal </div><div class="t m0 x1 h3 y51 ff4 fs2 fc0 sc0 ls0 ws0">information in the file we maintain about you, and other information we obtain from your current </div><div class="t m0 x1 h3 y52 ff4 fs2 fc0 sc0 ls0 ws0">and past activities on the Site to: resolve disputes; troubleshoot problems; help promote safe </div><div class="t m0 x1 h3 y53 ff4 fs2 fc0 sc0 ls0 ws0">trading; collect fees owed; measure c<span class="_ _0"></span>onsumer interest in the services provided by us, inform you </div><div class="t m0 x1 h3 y54 ff4 fs2 fc0 sc0 ls0 ws0">about online and offline offers, products, services, and updates; customize your experience; </div><div class="t m0 x1 h3 y55 ff4 fs2 fc0 sc0 ls0 ws0">detect and protect us against error, fraud a<span class="_ _0"></span>nd other criminal activity; enforce our User </div><div class="t m0 x1 h3 y56 ff4 fs2 fc0 sc0 ls0 ws0">Agreement; and as otherwise described to y<span class="_ _0"></span>ou at the time of collection. At times, we may look </div><div class="t m0 x1 h3 y57 ff4 fs2 fc0 sc0 ls0 ws0">across multiple users to identify problems or resolve disputes, and in particular we may<span class="_ _0"></span> examine </div><div class="t m0 x1 h3 y58 ff4 fs2 fc0 sc0 ls0 ws0">your personal information to identify use<span class="_ _0"></span>rs using multiple aliases. We may compare and review </div><div class="t m0 x1 h3 y59 ff4 fs2 fc0 sc0 ls0 ws0">your personal information for errors, omissions and for a<span class="_ _0"></span>ccuracy.  </div><div class="t m0 x1 h3 y5a ff4 fs2 fc0 sc0 ls0 ws0">If you choose to list an item for sale on the Site or open a c<span class="_ _0"></span>redit account, or otherwise provide us </div><div class="t m0 x1 h3 y5b ff4 fs2 fc0 sc0 ls0 ws0">with your financial information, we use your a<span class="_ _0"></span>ddress and billing information to bill <span class="_ _1"></span>y<span class="_ _0"></span>ou and </div><div class="t m0 x1 h3 y5c ff4 fs2 fc0 sc0 ls0 ws0">provide associated support. </div><div class="t m0 x1 h3 y5d ff4 fs2 fc0 sc0 ls0 ws0">You agree that we may use persona<span class="_ _0"></span>l information about <span class="_ _1"></span>you to improve<span class="_ _0"></span> our marketing and </div><div class="t m0 x1 h3 y5e ff4 fs2 fc0 sc0 ls0 ws0">promotional efforts, to analyze site usage, improve the Site&apos;s c<span class="_ _0"></span>ontent and product offerings, and </div><div class="t m0 x1 h3 y5f ff4 fs2 fc0 sc0 ls0 ws0">customize the Site&apos;s content, lay<span class="_ _0"></span>out, and services. These uses improve the Site and better tailor it </div><div class="t m0 x1 h3 y60 ff4 fs2 fc0 sc0 ls0 ws0">to meet your needs, so as to provide y<span class="_ _0"></span>ou with a smooth, efficient, safe and customiz<span class="_ _1"></span>ed </div><div class="t m0 x1 h3 y61 ff4 fs2 fc0 sc0 ls0 ws0">experience while using the Site. </div><div class="t m0 x1 h3 y62 ff4 fs2 fc0 sc0 ls0 ws0">You agree that we may use y<span class="_ _0"></span>our personal information to contact you and deliver information to </div><div class="t m0 x1 h3 y63 ff4 fs2 fc0 sc0 ls0 ws0">you that, in some cases, are targeted to your interests, such as targeted banner advertisements, </div><div class="t m0 x1 h3 y64 ff4 fs2 fc0 sc0 ls0 ws0">administrative notices, product offerings, and communications relevant to your use of the Site. </div><div class="t m0 x1 h3 y65 ff4 fs2 fc0 sc0 ls0 ws0">By accepting the User Agreement a<span class="_ _0"></span>nd Privacy Policy, you expressly agree to receive this </div><div class="t m0 x1 h3 y66 ff4 fs2 fc0 sc0 ls0 ws0">information. If you do not wish to receive these communications, we encourage you to opt out of </div><div class="t m0 x1 h3 y67 ff4 fs2 fc0 sc0 ls0 ws0">the receipt of certain communications in your profile. You may make<span class="_ _0"></span> changes to your profile at </div><div class="t m0 x1 h3 y68 ff4 fs2 fc0 sc0 ls0 ws0">any time. </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf4" class="pf w0 h0" data-page-no="4"><div class="pc pc4 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h4 y24 ff4 fs2 fc0 sc0 ls0 ws0">5. <span class="ff3">Our Disclosure of your information</span> </div><div class="t m0 x1 h3 y25 ff4 fs2 fc0 sc0 ls0 ws0">We may also use your information to deliver information to y<span class="_ _0"></span>ou that, in some cases, are targeted </div><div class="t m0 x1 h3 y26 ff4 fs2 fc0 sc0 ls0 ws0">to your interests, such as new services and promotions. The following are examples of some </div><div class="t m0 x1 h3 y27 ff4 fs2 fc0 sc0 ls0 ws0">categories of persons to whom we would share your information with from time-<span class="ls1">to</span>-time.  </div><div class="t m0 x1 h4 y69 ff4 fs2 fc0 sc0 ls0 ws0">1. <span class="ff3">Advertisements</span> </div><div class="t m0 x1 h3 y6a ff4 fs2 fc0 sc0 ls0 ws0">a. Where a user enters information on any form of an advertiser, the infor<span class="_ _0"></span>mation is </div><div class="t m0 x1 h5 y6b ff5 fs2 fc0 sc0 ls0 ws0">simultaneously collected by<span class="_ _0"></span> www.talegaon.co.in and the advertiser. The information is used by </div><div class="t m0 x1 h3 y6c ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in in accordance with<span class="ff4"> the terms of this privacy policy and is used by the </span></div><div class="t m0 x1 h5 y6d ff5 fs2 fc0 sc0 ls0 ws0">advertiser as per the advertisers prevalent privacy policies. Because<span class="_ _0"></span> we do not control the </div><div class="t m0 x1 h3 y4c ff4 fs2 fc0 sc0 ls0 ws0">privacy practices of these advertisers, you should evaluate their<span class="_ _0"></span> practices before deciding to </div><div class="t m0 x1 h3 y4d ff4 fs2 fc0 sc0 ls0 ws0">provide the said information.  </div><div class="t m0 x1 h5 y6e ff5 fs2 fc0 sc0 ls0 ws0">b. www.talegaon.co.in may also aggregate (gather<span class="_ _0"></span> up data across all user accounts) personally </div><div class="t m0 x1 h3 y4f ff4 fs2 fc0 sc0 ls0 ws0">identifiable information and disclose such information in a non-personally identifiable manner to </div><div class="t m0 x1 h3 y6f ff4 fs2 fc0 sc0 ls0 ws0">advertisers and other third parties for other marketing and promotional purposes. </div><div class="t m0 x1 h3 y51 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h3 y70 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h4 y71 ff4 fs2 fc0 sc0 ls0 ws0">2. <span class="ff3">Classifieds Listings</span> </div><div class="t m0 x1 h3 y72 ff4 fs2 fc0 sc0 ls0 ws0">a. When a user lists a classified advertiseme<span class="_ _0"></span>nt, and the advertisement receives an expression of </div><div class="t m0 x1 h3 y73 ff4 fs2 fc0 sc0 ls0 ws0">interest by the interested user, the intere<span class="_ _0"></span>sted user will be provided the contact information of the </div><div class="t m0 x1 h3 y74 ff4 fs2 fc0 sc0 ls0 ws0">user listing the advertisement as provided in that user&apos;s registration forms.  </div><div class="t m0 x1 h3 y75 ff4 fs2 fc0 sc0 ls0 ws0">b. When a user expresses an interest in a classified advertisement, the user who has listed the </div><div class="t m0 x1 h3 y76 ff4 fs2 fc0 sc0 ls0 ws0">advertisement will be provided the contact information of the intere<span class="_ _0"></span>sted user as provided in the </div><div class="t m0 x1 h3 y77 ff4 fs2 fc0 sc0 ls0 ws0">interested user&apos;s registration form. </div><div class="t m0 x1 h4 y78 ff4 fs2 fc0 sc0 ls0 ws0">3. <span class="ff3">Items and Services offered on the Site by third parties</span> </div><div class="t m0 x1 h3 y79 ff4 fs2 fc0 sc0 ls0 ws0">There are certain items and service<span class="_ _0"></span>s for which third parties request for information before the </div><div class="t m0 x1 h3 y7a ff4 fs2 fc0 sc0 ls0 ws0">item/service is listed on the Site (example: application for home-loan auctions). The information </div><div class="t m0 x1 h5 y7b ff5 fs2 fc0 sc0 ls0 ws0">provided by the user for such purposes is simultaneously collected by www.talega<span class="_ _0"></span>on.co.in and </div><div class="t m0 x1 h3 y7c ff4 fs2 fc0 sc0 ls0 ws0">the respective third party. This information is utilized by<span class="_ _0"></span> the third party in accordance with its </div><div class="t m0 x1 h3 y7d ff4 fs2 fc0 sc0 ls0 ws0">privacy policy and the terms of the offer. Because we do not control the privacy practice<span class="_ _0"></span>s of </div><div class="t m0 x1 h3 y7e ff4 fs2 fc0 sc0 ls0 ws0">these third parties, you should evaluate their practices before deciding<span class="_ _0"></span> to use their services.<span class="_ _1"></span> </div><div class="t m0 x1 h4 y7f ff4 fs2 fc0 sc0 ls0 ws0">4. <span class="ff3">Internal Service Providers.</span> </div><div class="t m0 x1 h3 y80 ff4 fs2 fc0 sc0 ls0 ws0">We may use third parties that we refer to as internal service providers to facilitate or outsource </div><div class="t m0 x1 h3 y81 ff4 fs2 fc0 sc0 ls0 ws0">one or more aspects of the business, product and service opera<span class="_ _0"></span>tions that we provide to you on the </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf5" class="pf w0 h0" data-page-no="5"><div class="pc pc5 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h3 y24 ff4 fs2 fc0 sc0 ls0 ws0">Site (e.g., search technology, discussion boards, bill collection, aff<span class="_ _0"></span>iliate and rewards programs, </div><div class="t m0 x1 h3 y4b ff4 fs2 fc0 sc0 ls2 ws0">co<span class="ls0">-branded credit cards) and therefore we may provide some of your personal information </span></div><div class="t m0 x1 h3 y82 ff4 fs2 fc0 sc0 ls0 ws0">directly to these internal service prov<span class="_ _0"></span>iders. These internal service providers&apos; are subject to </div><div class="t m0 x1 h3 y83 ff4 fs2 fc0 sc0 ls0 ws0">confidentiality agreements with us and other legal restrictions that prohibit their use of the </div><div class="t m0 x1 h3 y84 ff4 fs2 fc0 sc0 ls0 ws0">information we provide them for any other purpose except to facilitate the<span class="_ _0"></span> specific outsourced </div><div class="t m0 x1 h3 y85 ff4 fs2 fc0 sc0 ls0 ws0">Site related operation, unless you ha<span class="_ _0"></span>ve explicitl<span class="_ _1"></span>y ag<span class="_ _0"></span>reed or given your prior permission to them </div><div class="t m0 x1 h3 y86 ff4 fs2 fc0 sc0 ls0 ws0">for additional uses. In some instances, the internal service provider may collect infor<span class="_ _0"></span>mation </div><div class="t m0 x1 h3 y87 ff4 fs2 fc0 sc0 ls0 ws0">directly from you (such as for Site surveys or for a co-branded credit card). In these cases, you </div><div class="t m0 x1 h3 y88 ff4 fs2 fc0 sc0 ls0 ws0">will be notified of the involvement of the interna<span class="_ _0"></span>l service provider, and all additional information </div><div class="t m0 x1 h3 y89 ff4 fs2 fc0 sc0 ls0 ws0">you provide them and their additional uses will be strictly up to you. If y<span class="_ _0"></span>ou provide additional </div><div class="t m0 x1 h3 y8a ff4 fs2 fc0 sc0 ls0 ws0">information to an internal service provider directly<span class="_ _0"></span>, then their use of your personal information is </div><div class="t m0 x1 h3 y8b ff4 fs2 fc0 sc0 ls0 ws0">governed by their applicable privacy policy<span class="_ _0"></span>. </div><div class="t m0 x1 h4 y8c ff4 fs2 fc0 sc0 ls0 ws0">5. <span class="ff3">Other Corporate Entities</span>. </div><div class="t m0 x1 h3 y31 ff4 fs2 fc0 sc0 ls0 ws0">We share much of our data, including personal information about y<span class="_ _0"></span>ou, with our parent, affiliates, </div><div class="t m0 x1 h3 y32 ff4 fs2 fc0 sc0 ls0 ws0">subsidiaries, and joint ventures that are<span class="_ _0"></span> committed to serving your online trading needs and </div><div class="t m0 x1 h3 y33 ff4 fs2 fc0 sc0 ls0 ws0">related services, throughout the world. To the extent that these entities have access to your </div><div class="t m0 x1 h3 y8d ff4 fs2 fc0 sc0 ls0 ws0">information, they will treat it at least as protec<span class="_ _0"></span>tively as they treat information they obtain from </div><div class="t m0 x1 h3 y8e ff4 fs2 fc0 sc0 ls0 ws0">their other users. Our parent, affiliates, subsidiaries, and joint ventures follow privacy<span class="_ _0"></span> practices </div><div class="t m0 x1 h3 y8f ff4 fs2 fc0 sc0 ls0 ws0">no less protective of all users than our practice<span class="_ _0"></span>s described in this document, to the extent allowed </div><div class="t m0 x1 h5 y90 ff5 fs2 fc0 sc0 ls0 ws0">by applicable law. www.talegaon.c<span class="_ _0"></span>o.in, its parent, affiliates, subsidiaries, its joint ventures, or </div><div class="t m0 x1 h3 y91 ff4 fs2 fc0 sc0 ls0 ws0">any combination of such, will share some or a<span class="_ _0"></span>ll of your personal information with another </div><div class="t m0 x1 h3 y92 ff4 fs2 fc0 sc0 ls0 ws0">business entity should we plan to, merge with, or be acquired by that business entity<span class="_ _0"></span>. Should </div><div class="t m0 x1 h3 y93 ff4 fs2 fc0 sc0 ls0 ws0">such a combination occur, we will re<span class="_ _0"></span>quire that the new combined entity follow this privacy </div><div class="t m0 x1 h3 y94 ff4 fs2 fc0 sc0 ls0 ws0">policy with respect to your personal information.  </div><div class="t m0 x1 h4 y95 ff4 fs2 fc0 sc0 ls0 ws0">6. <span class="ff3">Legal Requests</span> </div><div class="t m0 x1 h3 y3d ff4 fs2 fc0 sc0 ls0 ws0">We cooperate with law enforcement and reg<span class="_ _0"></span>ulatory inquiries, as well as other third parties to </div><div class="t m0 x1 h3 y3e ff4 fs2 fc0 sc0 ls0 ws0">enforce laws, such as: intellectual property<span class="_ _0"></span> rights, fraud and other rights, to help protect you and </div><div class="t m0 x1 h3 y3f ff4 fs2 fc0 sc0 ls0 ws0">the community from bad actors. Therefore, in response to a verified request by law enforcement </div><div class="t m0 x1 h3 y40 ff4 fs2 fc0 sc0 ls0 ws0">or other government officials relating to a criminal investiga<span class="_ _0"></span>tion or alleged illegal activity, we </div><div class="t m0 x1 h3 y41 ff4 fs2 fc0 sc0 ls0 ws0">can (and you authorize us to) disclose your name, city, state, telephone number, email address, </div><div class="t m0 x1 h3 y42 ff4 fs2 fc0 sc0 ls0 ws0">Username history, fraud complaints, and listing history<span class="_ _0"></span> without a subpoena. Without limiting the </div><div class="t m0 x1 h3 y43 ff4 fs2 fc0 sc0 ls0 ws0">above, in an effort to respect your privacy a<span class="_ _0"></span>nd our ability to keep the community free from bad </div><div class="t m0 x1 h3 y96 ff4 fs2 fc0 sc0 ls0 ws0">actors, we will not otherwise disclose your personal information to law enforcement or other </div><div class="t m0 x1 h3 y97 ff4 fs2 fc0 sc0 ls0 ws0">government officials without a subpoena, court order or substantially similar legal procedure, </div><div class="t m0 x1 h3 y98 ff4 fs2 fc0 sc0 ls0 ws0">except when we believe in good faith that the disclosure of information is nece<span class="_ _0"></span>ssar<span class="_ _1"></span>y to pre<span class="_ _0"></span>vent </div><div class="t m0 x1 h3 y99 ff4 fs2 fc0 sc0 ls0 ws0">imminent physical harm or financial loss; or report suspected illegal activity<span class="_ _0"></span>. Further, we can </div><div class="t m0 x1 h3 y9a ff4 fs2 fc0 sc0 ls0 ws0">(and you authorize us to) disclose your name, street addre<span class="_ _0"></span>ss, city, state, zip code, country, phone </div><div class="t m0 x1 h3 y9b ff4 fs2 fc0 sc0 ls0 ws0">number, email, and company name to Intellectual Property<span class="_ _0"></span> rights owners under confidentiality </div><div class="t m0 x1 h3 y9c ff4 fs2 fc0 sc0 ls0 ws0">agreement, as we in our sole discretion believe<span class="_ _0"></span> necessary or appropriate in connection with an </div><div class="t m0 x1 h3 y9d ff4 fs2 fc0 sc0 ls0 ws0">investigation of fraud, intellectual property infringement, piracy, or other unlawful activity<span class="_ _0"></span>. <span class="_ _1"></span> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf6" class="pf w0 h0" data-page-no="6"><div class="pc pc6 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h3 y24 ff4 fs2 fc0 sc0 ls0 ws0">Due to the existing regulatory environment, we cannot ensure that a<span class="_ _0"></span>ll of you<span class="_ _1"></span>r private </div><div class="t m0 x1 h3 y4b ff4 fs2 fc0 sc0 ls0 ws0">communications and other personal information will never be disclosed in ways not otherwise<span class="_ _0"></span> </div><div class="t m0 x1 h3 y82 ff4 fs2 fc0 sc0 ls0 ws0">described in this Privacy Policy. By<span class="_ _0"></span> wa<span class="_ _1"></span>y of example (without limiting the foreg<span class="_ _0"></span>oing), we may be </div><div class="t m0 x1 h3 y83 ff4 fs2 fc0 sc0 ls0 ws0">forced to disclose personal information to the government or third parties under certain </div><div class="t m0 x1 h3 y84 ff4 fs2 fc0 sc0 ls0 ws0">circumstances, third parties may unlawfully intercept or acce<span class="_ _0"></span>ss transmissions or private </div><div class="t m0 x1 h3 y85 ff4 fs2 fc0 sc0 ls0 ws0">communications, or users may abuse or misuse your personal information that they<span class="_ _0"></span> collect from </div><div class="t m0 x1 h3 y86 ff4 fs2 fc0 sc0 ls0 ws0">the Site. Therefore, although we use industry standard practices to protect your privacy, we do </div><div class="t m0 x1 h3 y87 ff4 fs2 fc0 sc0 ls0 ws0">not promise, and you should not expect, that your personal infor<span class="_ _0"></span>mation or private </div><div class="t m0 x1 h3 y88 ff4 fs2 fc0 sc0 ls0 ws0">communications will always remain private. </div><div class="t m0 x1 h4 y9e ff4 fs2 fc0 sc0 ls0 ws0">7. <span class="ff3">Your use of other users&apos; information </span> </div><div class="t m0 x1 h3 y2e ff4 fs2 fc0 sc0 ls0 ws0">By entering into our User Agreement, you agree that, with respect to other user&apos;s personally<span class="_ _0"></span> </div><div class="t m0 x1 h3 y2f ff4 fs2 fc0 sc0 ls0 ws0">identifia