0 ls0 ws0">personally identifiable information about another user to any third party<span class="_ _0"></span> without our consent and </div><div class="t m0 x1 h3 y5b ff4 fs2 fc0 sc0 ls0 ws0">the consent of such other user after adequate disclosure. </div><div class="t m0 x1 h5 ya2 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in and our users do not tolerate spam. Therefore, without limiting the </div><div class="t m0 x1 h3 y5d ff5 fs2 fc0 sc0 ls0 ws0">foregoing, you are not licensed to add a www.talegaon.co.in user<span class="ff4">-even a user who has </span></div><div class="t m0 x1 h3 y5e ff4 fs2 fc0 sc0 ls0 ws0">purchased an item from you-to your mail list (email or physical mail) without their express </div><div class="t m0 x1 h3 y5f ff4 fs2 fc0 sc0 ls0 ws0">consent after adequate disclosure. </div><div class="t m0 x2 h4 ya3 ff7 fs3 fc0 sc0 ls0 ws0"><span class="ff8"> <span class="_ _2"> </span><span class="ff3 fs2">What about children&apos;s privacy?<span class="ff4"> </span></span></span></div><div class="t m0 x1 h3 ya4 ff4 fs2 fc0 sc0 ls0 ws0">Children are not eligible to use our Site and we ask that minors (under the<span class="_ _0"></span> age of 18) do not </div><div class="t m0 x1 h3 ya5 ff4 fs2 fc0 sc0 ls0 ws0">submit any personal information to us. If you are<span class="_ _0"></span> under the ag<span class="_ _1"></span>e of 18, you cannot sell, purchase </div><div class="t m0 x1 h3 ya6 ff4 fs2 fc0 sc0 ls0 ws0">for any items on the Site. If you wish to purc<span class="_ _0"></span>hase or sell an item on the Site such purchase or sale </div><div class="t m0 x1 h3 ya7 ff4 fs2 fc0 sc0 ls0 ws0">may be made by your legal guardian or parents who have reg<span class="_ _0"></span>istered as users of the Site provided </div><div class="t m0 x1 h3 ya8 ff4 fs2 fc0 sc0 ls0 ws0">that such purchase or sale is not in relation to any adult materia<span class="_ _0"></span>l/mature audience items displayed </div><div class="t m0 x1 h3 ya9 ff4 fs2 fc0 sc0 ls0 ws0">on the Site, the sale or purchase of which to/by minors is strictly prohibited </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf7" class="pf w0 h0" data-page-no="7"><div class="pc pc7 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x2 h4 yaa ff7 fs3 fc0 sc0 ls0 ws0"><span class="ff8"> <span class="_ _2"> </span><span class="ff3 fs2">Access or change your personally identifiable information <span class="ff4"> </span></span></span></div><div class="t m0 x1 h3 y25 ff4 fs2 fc0 sc0 ls0 ws0">To protect your privacy and security, we<span class="_ _0"></span> will verify your identit<span class="_ _1"></span>y before granting acce<span class="_ _0"></span>ss or </div><div class="t m0 x1 h3 y26 ff4 fs2 fc0 sc0 ls0 ws0">making changes to your personally-identifying information. If you have registered your profile </div><div class="t m0 x1 h5 y27 ff5 fs2 fc0 sc0 ls0 ws0">on www.talegaon.co.in, your www.talega<span class="_ _0"></span>on.co.in Username and Password are required in </div><div class="t m0 x1 h3 y28 ff4 fs2 fc0 sc0 ls0 ws0">order to access your profile information.  </div><div class="t m0 x2 h4 yab ff7 fs3 fc0 sc0 ls0 ws0"><span class="ff8"> <span class="_ _2"> </span><span class="ff3 fs2">Security<span class="ff4"> </span></span></span></div><div class="t m0 x1 h3 y6b ff4 fs2 fc0 sc0 ls0 ws0">When you place orders or access your account information, we offer the<span class="_ _0"></span> use of a secure server. </div><div class="t m0 x1 h3 y6c ff4 fs2 fc0 sc0 ls0 ws0">The secure server software (SSL) encrypts all information y<span class="_ _0"></span>ou put in before it is sent to us. </div><div class="t m0 x1 h3 y6d ff4 fs2 fc0 sc0 ls0 ws0">Furthermore, all of the customer data we collect is protected against unauthorized access. To </div><div class="t m0 x1 h3 y4c ff4 fs2 fc0 sc0 ls0 ws0">prevent unauthorized access, maintain data accuracy<span class="_ _0"></span>, and ensure correct use of information, we </div><div class="t m0 x1 h3 y4d ff4 fs2 fc0 sc0 ls0 ws0">will employ reasonable security practice<span class="_ _0"></span>s and procedures and current Internet security methods </div><div class="t m0 x1 h3 y4e ff4 fs2 fc0 sc0 ls0 ws0">and technologies in compliance with Information Technology Ac<span class="_ _0"></span>t, 2000 and rules made there </div><div class="t m0 x1 h3 yac ff4 fs2 fc0 sc0 ls0 ws0">under. </div><div class="t m0 x1 h4 y6f ff3 fs2 fc0 sc0 ls0 ws0">Your Consent: <span class="ff4">By using the Site and/ or by providing your inf<span class="_ _0"></span>ormation, you consent to the </span></div><div class="t m0 x1 h5 yad ff5 fs2 fc0 sc0 ls0 ws0">collection and use of the information you disclose on the Site by <span class="_ _0"></span>www.talegaon.co.in in </div><div class="t m0 x1 h3 yae ff4 fs2 fc0 sc0 ls0 ws0">accordance with this Privacy Policy, including but not limited to y<span class="_ _0"></span>our consent for sharing your </div><div class="t m0 x1 h3 yaf ff4 fs2 fc0 sc0 ls0 ws0">information as per: Internal Service Providers mentioned above. </div><div class="t m0 x1 h3 y54 ff4 fs2 fc0 sc0 ls0 ws0">If we decide to change our privacy policy<span class="_ _0"></span>, we will post those changes on this page so that <span class="_ _1"></span>you </div><div class="t m0 x1 h3 y55 ff4 fs2 fc0 sc0 ls0 ws0">are always aware of what information we collect, how we<span class="_ _0"></span> use it, and under what circumstances </div><div class="t m0 x1 h3 y56 ff4 fs2 fc0 sc0 ls0 ws0">we disclose it. Any changes to our privacy<span class="_ _0"></span> policy will be communicated through our Web site at </div><div class="t m0 x1 h3 y57 ff4 fs2 fc0 sc0 ls0 ws0">least 10 days in advance of implementation. </div><div class="t m0 x1 h4 yb0 ff3 fs2 fc0 sc0 ls0 ws0">Name and address of the entity collecting and retaining Your Information<span class="ff4"> </span></div><div class="t m0 x1 h3 yb1 ff4 fs2 fc0 sc0 ls0 ws0">Name and address of the entity collecting and retaining Your<span class="_ _0"></span> Information shall be the contracting </div><div class="t m0 x1 h3 yb2 ff4 fs2 fc0 sc0 ls0 ws0">entity stated in the <span class="ff5">www.talegaon.co.in User Agreement</span> </div><div class="t m0 x1 h4 yb3 ff3 fs2 fc0 sc0 ls0 ws0">Tell us what you think<span class="ff4"> </span></div><div class="t m0 x1 h5 yb4 ff5 fs2 fc0 sc0 ls0 ws0">At www.talegaon.co.in, we welcome your questions and comments regarding our privacy </div><div class="t m0 x1 h3 yb5 ff5 fs2 fc0 sc0 ls0 ws0">policy. You may contact www.talegaon.co.in at ajay<span class="_ _0"></span>joshi123.com@gmail.com<span class="_ _1"></span><span class="ff4"> </span></div><div class="t m0 x1 h6 yb6 ffa fs4 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
